// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-left">
        {/* Logo image from public/assets */}
        <img src="/assets/logo.png" alt="Autonomy Labs Logo" className="logo" />
        <Link to="/" className="header-title">Autonomy Labs</Link>
      </div>
      <nav className="header-nav">
        <Link to="/research" className="header-link">Product</Link>
        <Link to="/products" className="header-link">Research</Link>
        <Link to="/safety" className="header-link">Safety</Link>
        <Link to="/company" className="header-link">Company</Link>
      </nav>
      <div className="header-right">
        <button className="meeting-button">Schedule a Meeting</button>
      </div>
    </header>
  );
};

export default Header;
